'mail/chrome/messenger/aboutRights.dtd:rights.webservices-term1' => '&amp;vendorShortName; Қызметтерді ұсынудан бас тартуына не олардың жұмысын өзгертуге құқылы.',
'mail/chrome/messenger/preferences/applications.dtd:authRequired.button.accesskey' => 'в',
'mail/chrome/messenger/aboutRights.dtd:rights.webservices-term3' => 'Қызметтер «қалай бар», солай ұсынылады.  &amp;vendorShortName;, оның қызметкерлері, лицензиарлары, дистрибьюторлары осы арқылы кез келген тура не жанама кепіл беруден, оның ішінде Қызметтердің сатуға жарамдылығына не олардың сіздің көңіліңізден шығатындығына кепіл беруден бас тартады.  Қызметтерді таңдаудан, оны пайдаланудан туындайтын барлық қауіп сіздің мойныңызда.  Кейбір заңнамаға сәйкес жанама кепіл беруден бас тарту не оны шектеуге рұқсат етілмейді. Мұндай жағдайда кепіл беруден бас тарту сізге қатысты болмауы мүмкін.',
'mail/chrome/messenger/aboutRights.dtd:rights.webservices-term2' => '',
'mail/chrome/messenger/aboutRights.dtd:rights.webservices-term5' => '&amp;vendorShortName; қажетіне қарай осы шарттарды жаңартып отырады. Бұл шарттар &amp;vendorShortName; жазбаша рұқсатынсыз өзгеруі не тоқтатылуы мүмкін емес.',
'mail/chrome/messenger/aboutRights.dtd:rights.webservices-term4' => 'Заң талап ететін жағдайдан басқа кезде, &amp;vendorShortName; және оның қызметкерлері, лицензиарлары, дистрибьюторлары &amp;brandShortName; және Қызметтерді пайдаланудан туындаған не соларға қатысты ешқандай жанама, ерекше, кездейсоқ, салдарлы, айыппұл не жаза түріндегі зардаптарға жауап бермейді. Осыған байланысты ұжымдық жауапкершілік $500 (бес жүз АҚШ доллары) мөлшерінен аспайды. Кейбір заңнамаға сәйкес белгілі-бір зардапты өтеуден бас тарту не оны шектеуге рұқсат етілмейді. Мұндай жағдайда зардапты өтеуден бас тарту не оны шектеу сізге қатысты болмауы мүмкін.',
